// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";

contract CoffeeSupplyChain is Ownable {
    struct User {
        address walletAddress;
        string roleName;
        uint roleID;
        string nama;
        string telepon;
        string alamat;
        string foto;
    }

    struct Transaksi {
        string produkID;
        string varietas;
        uint kuantitas;
        address pengirim;
        address penerima;
        uint tanggalTransaksi;
        string status; // Tertunda atau Terkonfirmasi
    }

    struct Produk {
        string produkID;
        string kopiID;
        string varietas;
        uint kuantitas;
        uint tanggalProduksi;
        uint tanggalKadaluarsa;
        string foto;
        address pemilik;
    }

    mapping(address => User) public users;
    mapping(string => Transaksi) public transaksi; // Menggunakan produkID sebagai key
    mapping(string => Produk) public produk; // Menggunakan produkID sebagai key

    event ProdukDitambahkan(string produkID, string kopiID, string varietas, uint kuantitas, uint tanggalProduksi, uint tanggalKadaluarsa, string foto, address pemilik);
    event TransaksiDitambahkan(string produkID, string varietas, uint kuantitas, address pengirim, address penerima, uint tanggalTransaksi, string status);
    event TransaksiDikonfirmasi(string produkID, address penerima);
    event UserDitambahkan(address walletAddress, string roleName, uint roleID, string nama, string telepon, string alamat, string foto);

    constructor() Ownable(msg.sender) {}

    modifier onlyAuthorizedRoles() {
        require(users[msg.sender].roleID > 0 && users[msg.sender].roleID <= 5, "Peran tidak diizinkan");
        _;
    }

    modifier onlyPenerima(string memory _produkID) {
        require(transaksi[_produkID].penerima == msg.sender, "Hanya penerima yang bisa mengonfirmasi transaksi ini");
        _;
    }

    function addUser(address _walletAddress, string memory _roleName, uint _roleID, string memory _nama, string memory _telepon, string memory _alamat, string memory _foto) public onlyOwner {
        users[_walletAddress] = User(_walletAddress, _roleName, _roleID, _nama, _telepon, _alamat, _foto);
        emit UserDitambahkan(_walletAddress, _roleName, _roleID, _nama, _telepon, _alamat, _foto);
    }

    function addTransaksi(string memory _produkID, string memory _varietas, uint _kuantitas, address _penerima) public onlyAuthorizedRoles {
        transaksi[_produkID] = Transaksi(_produkID, _varietas, _kuantitas, msg.sender, _penerima, block.timestamp, "Tertunda");
        emit TransaksiDitambahkan(_produkID, _varietas, _kuantitas, msg.sender, _penerima, block.timestamp, "Tertunda");
    }

    function konfirmasiTransaksi(string memory _produkID) public onlyPenerima(_produkID) {
        transaksi[_produkID].status = "Terkonfirmasi";
        emit TransaksiDikonfirmasi(_produkID, msg.sender);
    }

    function addProduk(string memory _kopiID, string memory _varietas, uint _kuantitas, uint _tanggalProduksi, uint _tanggalKadaluarsa, string memory _foto) public onlyAuthorizedRoles {
        string memory produkID = string(abi.encodePacked(_kopiID, uint2str(block.timestamp))); // Menghasilkan ProdukID unik
        produk[produkID] = Produk(produkID, _kopiID, _varietas, _kuantitas, _tanggalProduksi, _tanggalKadaluarsa, _foto, msg.sender);
        // Produsen menambahkan transaksi baru dengan produkID
        addTransaksi(produkID, _varietas, _kuantitas, msg.sender);

        emit ProdukDitambahkan(produkID, _kopiID, _varietas, _kuantitas, _tanggalProduksi, _tanggalKadaluarsa, _foto, msg.sender);
    }

    function uint2str(uint _i) internal pure returns (string memory) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len;
        while (_i != 0) {
            k = k - 1;
            uint8 temp = (48 + uint8(_i - _i / 10 * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }
}

